sys_variable_value.value:
(function execute(inputs, outputs) {
    var groupSkillId = "";
    var recSysId = UXCGAFUtil.getSysId(inputs.table,'number',inputs.record_number);
    var nextBestActionRecommenderConfig = {};

    try {
		var inputObj = {};
		inputObj['table'] = inputs.table
		inputObj['usecase'] = inputs.use_case;
		inputObj['skill_id'] = "8092bdfe3bd312107bbddb9aa4e45ac0";
		inputObj['config_types'] = JSON.stringify({"nextBestActionRecommender":"c29e89ae3b6962108895bb7e53e45ad7"});

		var result = sn_fd.FlowAPI.getRunner().action('sn_uxc_gen_ai.agent_ai_config_fetcher').inForeground().withInputs(inputObj).run();
		var skill_config = result.getOutputs()?.['skill_config'];
		nextBestActionRecommenderConfig = JSON.parse(skill_config)?.["nextBestActionRecommender"];
		groupSkillId = nextBestActionRecommenderConfig?.["props"]?.["gaf_config"];
	} catch (ex) {
		gs.error("Failed to fetch skill configs: " + ex.getMessage());
	}

    var grpSysId = UXCGAFUtil.getGroupSysId(recSysId, inputs.table, inputs.record_number, groupSkillId);
    var recs = [];
    if (grpSysId) {
        recs = UXCGAFUtil.getGAFSimilarRecs(grpSysId, groupSkillId);
    } else {
        recs = UXCGAFUtil.getAisSimilarRecords(inputs.table, recSysId, inputs.use_case, nextBestActionRecommenderConfig);
    }
    outputs.references = JSON.stringify(recs);
})(inputs, outputs);

